import React, { useState } from 'react';
import axios from 'axios';


const Starwarapi = props => {
    const [responseDatas, setResponseData] = useState([]);


    const callStarwarApi = () => {
        axios.get(`https://swapi.dev/api`)
            .then(res => {
                setResponseData(res.data.label);
            }).catch(err => {
                console.log(err);
            });
    };

    return (


        <div>
            <div>
                <label>Search for:</label>
                <select onSelect={callStarwarApi}>
                    <option>
                        {
                            responseDatas.map((starwars) => {
                                return (
                                    <div>
                                        {starwars.people}
                                    </div>
                                )
                            })}</option>
                </select>
                <label>ID: </label>
                <input type="search" onSearch={(e) => {
                    return responseDatas.id
                }} />
                <button onClick={callStarwarApi}>Search</button>
            </div>
            {
                responseDatas.map((starwar) => {
                    return (
                        <div>
                            <span>{starwar.people}</span>
                        </div>
                    )
                })}
            {/* response.data.results */}
        </div>



    )
}

export default Starwarapi;
